import { createMuiTheme } from "@material-ui/core/styles";

const theme = createMuiTheme({
  palette: {
    primary: {
      light: "#c8d8e4",
      main: "#52AB98",
      dark: "#2B6777",
      contrastText: "#222",
    },
    secondary: {
      light: "#c8d8e4",
      main: "#52AB98",
      dark: "#2B6777",
      contrastText: "#eee",
    },
  },
});

export default theme;
